    "def build_model(name, encoder=\"resnet34\", classes=NUM_CLASSES, enc_weights=\"imagenet\"):\n",
    "    name = name.lower()\n",
    "    if name == \"unet\":\n",
    "        return smp.Unet(encoder_name=encoder, encoder_weights=enc_weights, classes=classes, activation=None)\n",
    "    if name == \"fpn\":\n",
    "        return smp.FPN(encoder_name=encoder, encoder_weights=enc_weights, classes=classes, activation=None)\n",
    "    if name == \"pspnet\":\n",
    "        return smp.PSPNet(encoder_name=encoder, encoder_weights=enc_weights, classes=classes, activation=None)\n",
    "    raise ValueError(\"Unknown model \"+name)\n",
    "\n",
    "# quick sanity: build and run a dummy batch to confirm shapes\n",
