    "        self.transform = transform\n",
    "        self.img_dir = IMG_DIR\n",
    "        self.mask_dir = MASK_DIR\n",
    "\n",
    "        imgs = [f for f in os.listdir(self.img_dir) if f.endswith(\".jpg\") or f.endswith(\".png\")]\n",
    "        # ðŸ”§ remove _sat if filenames don't match exactly\n",
    "        self.imgs = [f for f in imgs if os.path.exists(os.path.join(self.mask_dir, f.replace(\"_sat\", \"_mask\")))]\n",
    "\n",
    "        self.imgs = sorted(self.imgs)[:limit]\n",
    "        print(f\"Loaded {len(self.imgs)} valid image-mask pairs.\")\n",
    "\n",
    "    def __len__(self):\n",
    "        return len(self.imgs)\n",
    "\n",
    "    def __getitem__(self, idx):\n",
    "        img_name = self.imgs[idx]\n",
    "        img_path = os.path.join(self.img_dir, img_name)\n",
    "        mask_path = os.path.join(self.mask_dir, img_name.replace(\"_sat\", \"_mask\"))\n",
    "\n",
