    "import numpy as np\n",
    "\n",
    "# Assuming 'pred' is your segmentation output (class map)\n",
    "unique, counts = np.unique(pred, return_counts=True)\n",
    "total_pixels = pred.size\n",
    "\n",
    "# Define land cover mapping\n",
    "land_classes = {\n",
    "    0: \"Background\",\n",
    "    1: \"Agricultural Land\",\n",
    "    2: \"Barren Land\",\n",
    "    3: \"Water Bodies\",\n",
    "    4: \"Urban Areas\",\n",
    "    5: \"Drought Zones\",\n",
    "    6: \"Flooded Regions\"\n",
    "}\n",
    "\n",
    "# Compute and display %\n",
    "print(\"\\n Land Cover Distribution (in %):\\n\")\n",
    "percentages = {}\n",
    "for cls, count in zip(unique, counts):\n",
    "    land_name = land_classes.get(cls, f\"Class {cls}\")\n",
    "    percent = (count / total_pixels) * 100\n",
    "    percentages[land_name] = percent\n",
    "    print(f\"{land_name:20s}: {percent:.2f}%\")\n",
    "\n",
    "# Optional: visualize as a pie chart\n",
    "import matplotlib.pyplot as plt\n",
    "plt.figure(figsize=(7,7))\n",
    "plt.pie(percentages.values(), labels=percentages.keys(), autopct=\"%.1f%%\", startangle=140)\n",
    "plt.title(\"Land Cover Percentage Distribution\")\n",
    "plt.show()\n"
